#utility functions related to scraping


import requests
import pandas as pd
from scrapy.http import HtmlResponse
import json
from headers_cookies_data import headers_cookie_dict

rate_list_url = "https://www.marriott.com/reservation/rateListMenu.mi"


params = {
    "defaultTab": "prepay",
    "showFullPrice": "true",
}

def convert_list_of_dicts_to_csv(data, path):
    """Takes a list of dictionaries and returns a csv file"""

    df = pd.DataFrame(data, columns=data[0].keys())
    df.to_csv(path)


def find_price_before_tax(url, hotel_url, xpaths, params={}):
    params["showFullPrice"] = "false"

    response = requests.get(
        url,
        headers=headers_cookie_dict[hotel_url]["headers"],
        cookies=headers_cookie_dict[hotel_url]["cookies"],
        params=params,
    )

    html = HtmlResponse(url=url, body=response.text, encoding="utf-8")

    for xp in xpaths:
        price = html.xpath(xp).extract_first()
        try:
            price = price.replace(",","")
            price = float(price)

            return price

        except:
            pass


def get_cancel_policy(list_of_text):
    """Takes a list of text and returns the cancel policy"""

    for text in list_of_text:
        if "cancel" in text.lower():
            return text

    return None


def get_payment_policy(list_of_text):
    """Takes a list of text and returns the cancel policy"""

    for text in list_of_text:
        if "pay" in text.lower():
            return text

    return None


